import styled from "styled-components";
import Logo from "../logo/logo";

const TopBarBackground = styled.section`
    background-color: rgba(255, 255, 255, .15);  
    backdrop-filter: blur(5px);
    padding: 2%;
`

export default function TopBar() {
    return(
        <TopBarBackground>
            <Logo/>
        </TopBarBackground>
    );
}
